import React, { Component } from 'react';

class MarkerMap extends Component {

    componentDidMount() {

        // Load the Google Maps JavaScript API

        const script = document.createElement('script');

        script.src = `https://maps.googleapis.com/maps/api/js?key=YOUR_API_KEY&libraries=places`;

        script.async = true;

        script.defer = true;

        script.onload = this.initMap;

        document.head.appendChild(script);
    }

    initMap() {

        // Initialize the map

        const map = new window.google.maps.Map(document.getElementById('map'), {    

            center: { lat: 37.7749, lng: -122.4194 }, // Set your initial map center coordinates

            zoom: 12, // Set the initial zoom level

        });

        // Add markers to the map

        const marker = new window.google.maps.Marker({

            position: { lat: 37.7749, lng: -122.4194 }, // Set marker coordinates

            map: map,

            icon: '/logo192.png', // Path to your custom marker icon

            title: 'Custom Marker',

        });

    }

    render() {

        return <div id="map" style={{ width: '50%', height: '50vh', justifyContent:'center', alignItems:'center' }}></div>;

    }

}

export default MarkerMap;
